import React from 'react';
import BottomBar from '../../components/admin/adminHome/BottomBar';
import GetLastReservations from '../../components/admin/adminHome/GetLastReservation';


class AdminHome extends React.Component {
    render(){
    return (
        <div>
            <BottomBar />
            <div className='container'>
                <div className='row' style={{backgroundColor:'#0E1521', color: 'white', marginTop:'5%'}}>
                    <div className='col-12'>
                        <h5 className='text-center'>Nouvelles Reservations</h5>
                    </div>
                    <div className='row'>
                        <div className='col-12'>
                            <GetLastReservations />
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
    }
}

export default AdminHome
